import './contact.scss'

class Contact extends Component{
    render(){
        return(
            <div className="test">
                {/*<p>michaelAllan96@gmail.com</p>
                <p>https://www.linkedin.com/in/michael-allan-480a961a1</p>
                <p>https://github.com/MikeA96</p>*/}
                <img src="src/assets/images/LinkedIn-Logos/LI-Logo.png"/>
                <img src="src/assets/images/iconfinder_gmail_1220367.png"/><br/>
                <img src="src/assets/images/GitHub-Logos/GitHub_Logo_White.png"/>
            </div>
        )
    }
}
export default Contact
